import React from 'react';

const Header = () => {

    const handleHomeClick = () => {
        navigate("./");
    };

    return (
        <header className="bg-dark text-white p-4 d-flex justify-content-center align-items-center w-100 position-fixed top-0 start-0 z-10">
            <h1 className="fw-bold text-center m-0"
            onClick={handleHomeClick}>Gestor de productos</h1>
        </header>

    );
};

export default Header;
